    <div
      style={{
        backgroundColor: `${
          props.sender_id === props.user_id ? "rgb(54,57,62)" : "rgb(40,43,48)"
        }`,
        marginLeft: isSameSenderMargin(
          props.messages,
          props.m,
          props.i,
          props.user_id
        ),
        marginTop: isSameUser(props.messages, props.m, props.i, props.user_id)
          ? 7
          : 10,
        borderRadius: "20px",
        padding: "5px 15px",
        maxWidth: "75%",
        minWidth: "260px",
        color: "white",
        height: status == "submitted txn" ? "185px" : "100px",
      }}
    >
      <p class="payment_user">MultiSig</p>
      <p class="payment_user">To:amount</p>

      <p class="payment_note">note</p>
      <p class="payment_user">MultiSig</p>
      <p class="payment_user">To:amount</p>

      <p class="payment_note">note</p>
      <p class="payment_user">MultiSig</p>

    </div>
  );
};

export default GroupBox1;
